import React from 'react';

const Songs: React.FC = () => {
  const dispatch = useDispatch();
  const songs = useSelector((state: rootState) => state.songs.songs);

  useEffect(() => {
    dispatch(getSongsFetch());
  }, [dispatch]);

  return (
    <>
      <Cards />
      <Lists>
        {songs?.map((item, index) => (
          <List key={index} item={item} />
        ))}
      </Lists>
    </>
  );
};

export default App;
